import './App.css';
import HomePage from './pages/homepage/homepage.component';
import {Route, Routes} from 'react-router-dom';

const HatsPage = (props) => {
  console.log(props);
  return(
  <div>
    <h1> Hats Page </h1>
  </div>)
}


const SneakersPage = () => (
  <div>
    <h1> Sneakers Page </h1>
  </div>
)


const MenPage = () => (
  <div>
    <h1> Men Page </h1>
  </div>
)


const WomenPage = () => (
  <div>
    <h1> Women Page </h1>
  </div>
)


const JacketsPage = () => (
  <div>
    <h1> Hats Page </h1>
  </div>
)

function App() {
  return (
    <div >
      <Routes>

      <Route path='/' element={<HomePage />} />
      <Route path='/hats' element={<HatsPage />} />
      <Route path='/sneakers' element={<SneakersPage />} />
      <Route path='/jackets' element={<JacketsPage />} />
      <Route path='/men' element={<MenPage />} />
      <Route path='/sneakers' element={<WomenPage />} />

      </Routes>

    </div>
  );
}

export default App;
